- !!python/object:modelcatalog.models.dataset_specification.DatasetSpecification
  _description:
  - Cycles zipped weather and soil description files. The weather files typically
    have a suffix of .weather, but any suffix or file naming convention can be used
    so long as the name of the weather file listed in the control file exactly matches
    the name of the weather file to be used in the input directory. Weather files
    contain three lines at the beginning with the keyword tags LATITUDE, ALTITUDE,
    and SCREENING_HEIGHT, each followed by a tab-delimited value. Altitude and screening
    height values should be entered in meters. Screening height is the height of the
    weather station instruments above the land surface. Following these three lines
    is a row of tab-delimited column headers in the order YEAR, DOY, PP, TX, TN, SOLAR,
    RHX, RHN, WIND. Soil files typically have a suffix of .soil, but any naming convention
    can be used as long as it matches the soil file name listed in the control file.
    The soil file starts with three lines at the beginning with the keyword tags CURVE_NUMBER,
    SLOPE, and TOTAL_LAYERS, with each keyword followed by a tab-delimited value.
  _has_dimensionality:
  - 0
